import React, { useEffect } from 'react';
import {Link} from "react-router-dom";

const Navbar = () => {
    let api="https://api.rss2json.com/v1/api.json?rss_url=https%3A%2F%2Ftimesofindia.indiatimes.com%2Frssfeedstopstories.cms";
   
   const fetchApiData=async(url)=>{
    try {
        const res=await fetch(url);
        const data=await res.json();
        console.log(data.items);
    } catch (error) {
        console.log(error);
    }
   }
    useEffect(()=>{
        fetchApiData(api);
    },[]);
   
  return (
    <div className="nav">
    <input type="checkbox" id="check" />
    <label htmlFor="check" className='checkbtn'>
    <i className="fa-sharp  fa-solid fa-bars"></i>
    </label>
    <img src="newsexpress.png" alt="News logo" className='logo' />
    <ul>
        <li><Link to="/" >HOME</Link></li>
        <li><Link to="/about">SPORTS</Link></li>
        <li>SCIENCE</li>
        <li>ENVIRONMENT</li>
        <li>TECHNOLOGY</li>
        <li>ENTERTAINMENT</li>
    </ul>
    </div>
  )
}

export default Navbar;
